import React from "react";

function Footer() {
  return (
    <div className="footer">
      <footer class="py-4 bg-dark fixed-bottom">
        <div class="container">
          <p class="m-0 text-center text-white">
          &copy; 2023 The TravelBae. All rights reserved.
          </p>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
